import React from 'react'
import { useEffect, useState } from "react";

const Payment = () => {
    const [data, setData] = useState([]);

  const fetchData = () => {
    fetch(`http://localhost:4040/products`)
      .then((response) => response.json())
      .then((actualData) => {
        console.log(actualData);
        setData(actualData);
        console.log(data);
      })
      .catch((err) => {
        console.log(err.message);
      });
  };

  useEffect(() => {
    fetchData();
  }, []);
  return (
     <table>
      <tbody>
        <tr>
          <th>S.No</th>
          <th>Name</th>
          <th>Description</th>
          <th>Price</th>
        </tr>
        {data.map((item, num) => (
          <tr key={item.id}>
            <td>{num+1}</td>
            <td>{item.data1.name}</td>
            <td>
             {item.desc}  
            </td>
            <td>{item.price}</td>
          </tr>
        ))}
      </tbody>
    </table>
  )
}

export default Payment
